import React from 'react'

import { connect } from 'react-redux';

import {
  Col,
  Row,
  Table,
  Image,
} from 'react-bootstrap';


import Pages from '../Pages/Pages';

function ManageProducts(props) {
    return (
      <>
        <Row className="mt-5">
          <p className="my-agents-table-label">Products management</p>
        </Row>

        {/* <Pages /> */}


      </>
    )
}

const mapStateToProps = (state) => {
  return {
    socialMediaPageSelected : state.socialMediaR.socialMediaPageSelected,
  }
};

export default connect(mapStateToProps, { })(ManageProducts);
